game.TitleScreen=me.ScreenObject.extend({init:function(){this._super(me.ScreenObject,"init");this.font=null;this.fence1=null;this.fence2=null;this.logo=null},onResetEvent:function(){var a=this;game.data.newHiScore=false;me.game.world.addChild(new BackgroundLayer("splash",1));me.input.bindKey(me.input.KEY.ENTER,"enter",true);me.input.bindKey(me.input.KEY.SPACE,"enter",true);me.input.bindPointer(me.input.pointer.LEFT,me.input.KEY.ENTER);this.handler=me.event.subscribe(me.event.KEYDOWN,function(c,d,b){if(c==="enter"){me.state.change(me.state.PLAY)}})},onDestroyEvent:function(){me.event.unsubscribe(this.handler);me.input.unbindKey(me.input.KEY.ENTER);me.input.unbindKey(me.input.KEY.SPACE);me.input.unbindPointer(me.input.pointer.LEFT);this.fence1=null;this.fence2=null;this.logo=null}});